sys_script_include.script:
var celleditGlide = Class.create();
celleditGlide.prototype = Object.extendsObject(global.AbstractAjaxProcessor, {
validateDates:function(){
	var newDate=this.getParameter("syssparm_newValue");
	var gr=new GlideRecord('incident');
	gr.addQuery('sys-id',this.getParameter('syssparm_name'));
	gr.query();
	if(gr.next()){
		if(newDate>gr.u_end_date){
			return 'AbortAction';
		}
		else if(newDate<gr.u_end_date){
			return 'submitAction';
		}
	}

},


    type: 'celleditGlide'
});
